import React from 'react';
import './App.css';
import Header from './components/header/Header';
import Home from './home/Home';
import About from './about/About';
import Skills from './skills/Skills';
import Services from './services/services';

const App =()=> {
  return (
    <>

    <Header />
    <main className="main">
    <Home /> 
    <About />
    <Skills />
    <Services />

    </main>


    </>
  );
}

export default App;
